import './cart.css'

const ProductCart = (props) => {
  return (
    <div className='cart'>
        <div className="cart-imag">
            <img src={props.data.image} alt="" />
        </div>
        <div className="cart-content"></div>


    </div>
  )
}

export default ProductCart
